const Template = (props) => {
  let test = 'testing Text';




  return (
    <div>
      {props.data.map((data) => (
        <div>
          <div>
            <textarea />

            {}
            {test}
          <p>{data.name}</p>
          <p>{data.firstname}</p>
          <p>{data.job}</p>
          <p>{data.email}</p>
          <p>{data.phone}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Template;
